svg.script:
var YearlyCalendar = new function()
{
  var CalDate = new Date();
  var Months = new Array("Enero","Febrero","Marzo","Abril","Mayo","Junio","Julio","Agosto","Septiembre","Octubre","Noviembre","Diciembre");
  var Days = new Array(31,28,31,30,31,30,31,31,30,31,30,31);

  //Calendar Defaults - changed by passing parameters in the query string of the URL
  var year = CalDate.getFullYear();  //set = 4 digit year for that year
  var reqMonth=0;  // set = CalDate.getMonth()+1; to display the current month
  var LunesFirst = false;

  var dy;
  var events = '{"Calendar":"Example","events":[';
  events += '{"month":1,"day":1,"year":null,"desc":"Día de Año Nuevo"},';
  events += '{"month":2,"day":14,"year":null,"desc":"Día de San Valentín"},';
  events += '{"month":3,"day":17,"year":null,"desc":"Día de San Patricio"},';
  events += '{"month":4,"day":22,"year":null,"desc":"día de la Tierra"},';
  events += '{"month":5,"day":5,"year":null,"desc":"Cinco de Mayo"},';
  events += '{"month":6,"day":21,"year":null,"desc":"solsticio de verano"},';
  events += '{"month":10,"day":31,"year":null,"desc":"Todos los Santos"},';
  events += '{"month":10,"day":31,"year":null,"desc":"Víspera de"},';
  events += '{"month":12,"day":21,"year":null,"desc":"solsticio de invierno"},';
  events += '{"month":12,"day":25,"year":null,"desc":"día de Navidad"}]}';

  var json = JSON.parse(events);


  var qs = location.search;

  if(qs.length!=0)
  {
    qs = qs.replace("?","");
    var params = qs.split("&");
    for(var i=0;i<params.length;i++)
    {
      var values = params[i].split("=");
      if(values[0]=="a%C3%B1o")
      {
        if(!isNaN(values[1]))
        {
          if(values[1].length==4)
          {
            year = Number(values[1]);
            if(year < 0 || year > 5000) year = CalDate.getFullYear();
          }
        }
      }
      if(values[0]=="mes")
      {
        if(values[1].toLowerCase()=="ahora")
        {
          reqMonth = CalDate.getMonth()+1;
        }
        else
        {
          if(!isNaN(values[1]))
          {
            reqMonth = Number(values[1]);
            if(reqMonth < 0 || reqMonth > 12) reqMonth = 0;
          }
        }
      }
      if(values[0].toLowerCase()=="fdow" && values[1].toLowerCase()=="lunes")
      {
        LunesFirst = true;
      }
    }
  }
  if(year%400==0 || (year%100!=0 && year%4==0)) Days[1]=29;

  window.addEventListener("load",generateCalendar);

  function generateCalendar()
  {
    var i;

    if(LunesFirst)
    {
      document.getElementById("domingo").setAttribute("transform","translate(660,0)");
      document.getElementById("lunes").setAttribute("transform","translate(-110,0)");
    }

    document.getElementById(Months[0]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(0);} );
    document.getElementById(Months[1]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(1);} );
    document.getElementById(Months[2]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(2);} );
    document.getElementById(Months[3]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(3);} );
    document.getElementById(Months[4]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(4);} );
    document.getElementById(Months[5]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(5);} );
    document.getElementById(Months[6]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(6);} );
    document.getElementById(Months[7]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(7);} );
    document.getElementById(Months[8]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(8);} );
    document.getElementById(Months[9]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(9);} );
    document.getElementById(Months[10]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(10);} );
    document.getElementById(Months[11]).addEventListener("click",function(e) {e.preventDefault(); displayMonth(11);} );
    for(i=0;i<12;i++)
    {
      generateMonth(i);
    }
    if(reqMonth!=0) displayMonth(reqMonth-1);
  }

  function displayMonth(m)
  {
    var node;

    var x=(m%4)*800;
    var y=Math.floor(m/4)*520;
    document.documentElement.setAttribute("viewBox",x+" "+y+" 800 520");

    node = document.getElementById("cp");
    node.setAttribute("x",x);
    node.setAttribute("y",y);

    node = document.getElementById("Year");
    node.setAttribute("style","clip-path:url(#cp1);");
  }

  function displayYear()
  {
    document.documentElement.setAttribute("viewBox","0 0 3200 1560");
    document.getElementById("Year").removeAttribute("style");
  }

  function generateMonth(m)
  {
    CalDate.setMonth(m);
    CalDate.setDate(1);
    CalDate.setFullYear(year);

    var i;
    var node;
    var dayEvents;
    var yoffset;
    var id=Months[m].substr(0,3);

    document.getElementById(id+"Title").addEventListener("click",function(e) {displayYear(); e.stopPropagation(); } );

    var dow = CalDate.getDay();
    if(LunesFirst)
    {
      dow--;
      if(dow<0) dow=6;
    }
    var month = CalDate.getMonth();

    document.getElementById("MonthOf"+id).firstChild.nodeValue = Months[m]+" "+year;

    dy=38;
    if((dow+Days[month])<29)
    {
      for(i=1;i<4;i++)
      {
        yoffset = Math.round(400/4*i*100)/100 + 65;
        node = document.getElementById(id+(i*7+1)).parentNode;
        node.setAttribute("transform","translate(5,"+yoffset+")");

        yoffset = Math.round(400/4*i*100)/100 + 40;
        node = document.getElementById(id+"L"+i);
        node.setAttribute("transform","translate(0,"+yoffset+")");
      }
      node = document.getElementById(id+"L4");
      node.setAttribute("class","hide");
      node = document.getElementById(id+"L5");
      node.setAttribute("class","hide");
      dy=45;
    }
    else if((dow+Days[month])<36)
    {
      for(i=1;i<5;i++)
      {
        yoffset = Math.round(400/5*i*100)/100 + 65;
        node = document.getElementById(id+(i*7+1)).parentNode;
        node.setAttribute("transform","translate(5,"+yoffset+")");

        yoffset = Math.round(400/5*i*100)/100 + 40;
        node = document.getElementById(id+"L"+i);
        node.setAttribute("transform","translate(0,"+yoffset+")");
      }
      node = document.getElementById(id+"L5");
      node.setAttribute("class","hide");
      dy=45;
    }

    for(i=0;i<Days[month];i++)
    {
      node = document.getElementById(id+(i+1+dow));
      node.firstChild.nodeValue = i+1;
      dayEvents = CheckEvents(m+1,i+1);
      for(var j=0;j<dayEvents.length;j++)
      {
        AddEvent(node,dayEvents[j])
        node.setAttribute("style","fill:red");
      }
    }

  }

  function CheckEvents(month, day)
  {
    var items = new Array;
    for(var i=0;i<json.events.length;i++)
    {
      if(json.events[i].month==month && json.events[i].day==day)
      {
        var eventYear = json.events[i].year;
        if(eventYear==null) items.push(json.events[i].desc);
        else
        {
          if(eventYear==year) items.push(json.events[i].desc);
        }
      }
    }
    return(items);
  }

  function AddEvent(node, strEvent)
  {
    try
    {
      var newNode = document.createElementNS("http://www.w3.org/2000/svg","tspan");
      newNode.setAttribute("x","0");
      if(node.getElementsByTagName("tspan").length>0)
      {
        newNode.setAttribute("dy","-15");
      }
      else
      {
        newNode.setAttribute("dy",dy);
      }
      newNode.setAttribute("class","event");
      if(strEvent.length>14) newNode.setAttribute("style","font-size:12px");
      if(strEvent.length>19) newNode.setAttribute("style","font-size:10px");
      newNode.appendChild(document.createTextNode(strEvent));

      node.appendChild(newNode);
    }
    catch(e) {}
   }


}();
